import React from "react";
import { Link, useLocation } from "react-router-dom";
import "../assets/navbar.css"



function NavBar() {
    const location = useLocation();
    const isLoginPage = location.pathname === '/login'
    return (<div>
        <nav id="navbar">
            <ul>
                <li className="Navbar_element"><Link to="/">Home</Link></li>
                <li className="Navbar_element"><Link to={isLoginPage ? '/signup' : '/login'}>{isLoginPage ? 'Sign In' : 'Log In'}</Link></li>
                <li className="Navbar_element"><Link to='/reservations'>Reservations</Link> </li>
                {/* <li className="Navbar_element"><Link to='/menu'>Menu</Link></li>
                <li className="Navbar_element"><Link to='/contact'>Contact Us</Link></li> */}
            </ul>
        </nav>
    </div>)
}

export default NavBar;
